import React from 'react';
import {
    Card,
    CardTitle,
    CardBody,

} from 'reactstrap';

const EmployeeCard = props => {
    return (
        <div>
            <Card>
                <CardBody>
                    <CardTitle>{props.props.firstName} {props.props.lastName}</CardTitle>
                </CardBody>
            </Card>
        </div>
    );
};

export default EmployeeCard;
